-- distributor_order
SELECT
    NOW() - INTERVAL FLOOR(RAND() * 365 * 3 * 24 * 60 * 60) SECOND AS order_date,
    FLOOR(1 + RAND() * 299) AS store_id,
    FLOOR(1 + RAND() * 13) AS shipping_method_id,
    FLOOR(1 + RAND() * 7) AS status_id
FROM store s
LIMIT 250;

select * from distributor_order where order_id = 1;

